import axios from "axios";

import { Diagnosis } from "../types";

import { apiBaseUrl } from "../constants";

export const getDiagnosis = async () => {
  const { data } = await axios.get<Diagnosis[]>(
    `${apiBaseUrl}/diagnosis`
  );

  return data;
};



export default getDiagnosis
